const api = "http://jsonplaceholder.typicode.com/photos?_limit=30";

class App extends Component {

  constructor(props){
    super(props);
    this.state = {photos:[]}
  }

  componentDidMount(){
    fetch(api)
    .then(response => response.json())
    .then((photos) => {
      console.log(photos);
    })
    .catch(err => {
      console.log(err)
    })
  }

  render() {
    return (
      <section>

      </section>
    );
  }
}

export default App;
